COMPANY_FOUNDED_TEXT:"Gamers, nerds, moms, dads, engineers, designers, marketers, support. Discord is a small group of passionate gamers whose mission is to bring people together around games. Diversity and inclusiveness are a critical part of how we get there. We believe that with diversity comes a better product, better decisions, and a better work environment. Everyone here is committed to making Discord representative of the world we want to live and play in.",COMPANY_HERO_HEADING:"We built Discord to bring gamers together",COMPANY_HERO_TEXT:"The best relationships in our lives were built around playing games. Memories of staying up late playing Warcraft 3 with friends or sharing creations in The Sims mean so much to us. Discord's free voice and text chat is about making it easier for you to spend time with the people you care about, create these memories, and land a headshot or two.",COMPANY_HIRING_BUTTON:"Check out our open positions",
COMPANY_HIRING_HEADING:'Come make some Discord in "Sunny" San Francisco',COMPANY_HIRING_TEXT:"Become part of a passionate group of gamers passionate about passionately crafting exceptional products theyâ€™re passionate about. Whew.",COMPANY_INVESTORS_HEADING:"Some of the smartest investors believe in us",COMPANY_INVESTORS_TEXT:"We've raised over {fundingAmount} from top VCs in the valley like Greylock, Benchmark, and Tencent. In other words, we'll be around for a while.",COMPANY_PRESS_HEADING:"Weâ€™ll just leave these here...",COMPANY_PRESS_TEXT_1:'"Honestly, Discord is just killing it from their tech to their people. Excited to see what comes next."',COMPANY_PRESS_SOURCE_1:"Top Twitch Streamer",COMPANY_PRESS_TEXT_2:'"Our close knit community wouldn\'t have been made possible without Discord - it was the perfect tool to bring our community to the next level."',COMPANY_PRESS_SOURCE_2:"/r/overwatch mod",
COMPANY_PRESS_TEXT_3:"\"Discord is an increasingly big deal and it's worth your time to take a look if you're seeking more ways to connect with the communities around the games you play.\"",COMPANY_STATS_HEADING:"A lot of people use Discord",COMPANY_STATS_TEXT:"And a lot of them use it every day",COMPANY_STATS_TEXT_1:"Monthly players",COMPANY_STATS_TEXT_2:"Peak current players",COMPANY_STATS_TEXT_3:"Messages sent a day",COMPANY_TWEETS_HEADING:"People really <3 us too",COMPANY_TWEETS_LINK_1:"https://twitter.com/RivalEsportsGG/status/864916530286411776",COMPANY_TWEETS_LINK_2:"https://twitter.com/sn0wbirdtbh/status/864934396373151745",COMPANY_TWEETS_LINK_3:"https://twitter.com/lovelessashi/status/864953511850594304",COMPANY_TWEETS_NAME_1:"Pro Rivalry League",COMPANY_TWEETS_NAME_2:"snowbird",COMPANY_TWEETS_NAME_3:"Princess Ashley",COMPANY_TWEETS_TEXT:"You don't need to look much farther than our [Twitter stream]({link}) to see the sentiment",
COMPANY_TWEETS_TEXT_1:"Discord has helped us run our organization, make new friends, and experience unforgettable moments. We couldn't do without it.",COMPANY_TWEETS_TEXT_2:"Discord is the most stable VOIP service available. Its intuitive and customizable design offers top of the line service for any community.",COMPANY_TWEETS_TEXT_3:"Discord has wonderful uptime, quality sound, amazing features, simplicity, customizable, seamless, gaming overlay, quick bug fixes, awesome PR, and more.",COMPANY_TWEETS_USERNAME_1:"RivalEsportsGG",COMPANY_TWEETS_USERNAME_2:"sn0wbirdtbh",COMPANY_TWEETS_USERNAME_3:"lovelessashi",COMPANY_REFRESH_HIRING_HEADING:"Come make some Discord with us",COMPANY_REFRESH_HIRING_BUTTON_2:"Open Jobs",COMPANY_REFRESH_HIRING_TEXT_2:" Become part of a group of passionate people passionately crafting exceptional products theyâ€™re passionate about. Weâ€™re also passionate about health and safety, so youâ€™ll be kicking it from your couch while our office is closed.",
