JOB_FORM_EEOC_STATEMENT:"Discord is committed to diversity and inclusion throughout someoneâ€™s entire Discord experience. Participating in this voluntary survey will help us understand the diversity of our candidates and evaluate where we can do more. This survey is completely voluntary and anonymous and not attached to your application in any way. It is not visible by hiring managers and participation in this survey does not impact the outcome of your application. Declining to fill out this survey will not affect your Discord experience. Thank you for helping us evolve our diversity and inclusion efforts.",JOB_ANTI_DISCRIMINATION_NOTICE:"Anti-Discrimination Notice: It is an unlawful employment practice for an employer to fail or refuse to hire or discharge any individual, or otherwise to discriminate against any individual with respect to that individualâ€™s terms and conditions of employment, because of such individualâ€™s race, color, religion, sex, or national origin.",
JOB_SUBMITTED_TITLE:"You did the thing!",JOB_SUBMITTED_SUBTITLE:"Thanks so much for applying. Weâ€™ll check out your application and get back to you shortly.",JOB_QUESTION_LOAD_ERROR:"We're so sorry! There was trouble fetching this job's questions. Try refreshing the page, if you still see this\n  error, please contact our support team [here](mailto:support@discord.com).",JOB_REFRESH_METADATA_TITLE:"!!{job}!! at Discord",JOB_REFRESH_VALUES_TITLE:"Our Values",JOBS_METADATA_TITLE:"Jobs at Discord",JOBS_METADATA_OGTITLE:"Discord Jobs and Company Information",JOBS_METADATA_DESCRIPTION:"Apply for jobs at Discord HQ and build a sweet chat app that millions of gamers use to play with their friends. Check out company information including perks and location.",JOBS_APPLY_NOW:"Apply Now",JOBS_CTA_HEADING:"Pretty neat so far, huh?",
JOBS_CTA_TEXT_1:"[Discord's culture is something we care deeply about]({link}). We take time to make sure weâ€™re building a rewarding, challenging, and positive company where people can thrive doing their best work.",JOBS_CTA_TEXT_2:"So, want to work in a beautiful office in an awesome city with great people building something that impacts millions of gamers?",JOBS_CTA_BUTTON:"See all openings",JOBS_ERROR_404:"We couldn't find the job you requested, but we have plenty more on our [Jobs page]({link})",JOBS_ERROR_API_FALL_DOWN_GO_BOOM:"Our job operational unit seems to be down. We're fixing it, please check back soon.",JOBS_HERO_HEADING:"Work for Discord",JOBS_HERO_TEXT_1:"Discord is home to passionate people who value our mission â€” bringing people together around games.",JOBS_HERO_BUTTON:"See what's open",JOBS_JOBS_HEADING:"Job Openings",
