JOBS_REFRESH_METADATA_TITLE:"Jobs and Career Opportunities at Discord",JOBS_REFRESH_METADATA_DESCRIPTION:"Apply for jobs at Discord and build an easy-to-use communication service for people to talk, chat, and hang out.",JOBS_REFRESH_HERO_HEADING:"Work at Discord",JOBS_REFRESH_HERO_BODY:"Discord is home to passionate people who value our missionâ€”empowering you to create belonging in your life.",JOBS_REFRESH_DESCRIPTION_TITLE_2:"We'd love to work with someone like you.",
JOBS_REFRESH_DESCRIPTION_BODY_3:"We care about creating a delightful experience: for people who use Discord and for ourselves. We value a workplace that's as diverse as our product. People here do work that matters. We keep moving forward with a figure-it-out mentality. And above all, we remember to work with empathy, kindness, and compassion.\n\n  All of [our values]({blogLink}) help us make a better product, better decisions, and foster a better work environment. As we continue to grow, we stay dedicated to building a company that is representative of the world we live and play in. We'd love your help.\n  ",JOBS_REFRESH_FILTER:"Filters",JOBS_REFRESH_PERKS_TITLE:"Top-tier perks and benefits:",JOBS_REFRESH_PERKS_DISCORD_HQ_TITLE:"Discord HQ",
JOBS_REFRESH_PERKS_DISCORD_HQ_BODY:"Our platform is our headquarters! Because we believe great work isn't tied to a physical space, most of our roles offer flexibility â€” whether it's from the comfort of your home (in approved locations), an inspiring office setting or a combo of both! No matter where your desk lives, we offer generous support to help you remain productive and engaged.",JOBS_REFRESH_PERKS_GROW_TOGETHER_TITLE:"Grow together",JOBS_REFRESH_PERKS_GROW_TOGETHER_BODY:"Look forward to developing both professionally and personally alongside your colleagues at Discord. All of our managers go through a leadership program, and we offer diverse trainings for everyone. No matter what your interests or skills are, there's a place on our platform for you to find and build belonging.",JOBS_REFRESH_PERKS_MONEY_TITLE:"Money matters",
