PARTNERS_FAQ_ANSWER_1_1:"Someone who appreciates me for who I am and likes long walks on the beaches and candle-lit dinners and... wait, I think I misread the question.",PARTNERS_FAQ_ANSWER_1_2:"Really, we look for thriving communities and content creators that show an authentic enthusiasm for Discord. We want to support communities that support us. Numbers on other platforms donâ€™t always represent a engaged Discord community, so we donâ€™t require specific, non-Discord related numbers like views or followers. Acceptance as a Partner is based on your server. More details on what we use to determine acceptance be found above or in our [Help Center article](https://support.discord.com/hc/articles/115001494012). However, meeting these requirements does not guarantee acceptance. Acceptance is based on both quantitative and qualitative factors, and will vary from one candidate to the next.",
